@BruunGarcia @stinuslindgreen Brian, jeg synes du går noget over grænsen her.
Stinus er generelt en ret ordentlig person, nyvalgt, og der er ingen grund til at insinuere at han tænker på sine egne interesser i den her sammenhæng.
Jeg forstår godt instinktet, det er udbredt, og jeg kan også føle det, men..
